import MyNavbar from "../../components/MyNavbar/MyNavbar"
import SerialsCards from "../../components/SerialsCards/SerialsCards"
import { serials } from "../../groupsData"


    function watchSerials() {
      return (
        <>
          <MyNavbar />
          div.
          {serials.map((serial) => (
            <SerialsCards {...serial} />
          ))}
        </>
      );
    }
export default watchSerials
